		p.setMultiConstraint(4,'GivenArray',[[111,232,276,334,387,557,639,645,735,743,774,789,824,916,993]])
		p.setMultiConstraint(5,'GivenArray',[[193,239,271,324,377,552,666,674,729,736,765,772,883,911,998]])
		
		self.assertEqual(p.countSolutions(test=True),'1:','Failed Shoji')
		
